import { h } from '@stencil/core';
import { IconCode } from '../components/icons/code.js';
import { IconEllipsisHorizontal } from '../components/icons/ellipsis-horizontal.js';
import { IconImages } from '../components/icons/images.js';
import { IconList } from '../components/icons/list.js';
export const renderIcon = (icon) => {
  switch (icon) {
    case 'code':
      return h(IconCode, null);
    case 'ul':
      return h(IconList, null);
    case 'hr':
      return h(IconEllipsisHorizontal, null);
    case 'img':
      return h(IconImages, null);
    default:
      return undefined;
  }
};
